import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons

// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Button from "components/CustomButtons/Button.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import Parallax from "components/Parallax/Parallax.js";

import styles from "assets/jss/material-kit-react/views/pageStyle.js";

// Sections for this page
import ProductSection from "./LandingPage/Sections/ProductSection.js"
import TeamSection from "./LandingPage/Sections/TeamSection.js";
import WorkSection from "./LandingPage/Sections/WorkSection.js";

const dashboardRoutes = [];

const useStyles = makeStyles(styles);

export default function Contact(props) {
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div className={classNames(classes.main, classes.mainRaised)}>
        <div className={classes.container}>
        <div className={classes.section}>
            <GridContainer justify="center">
                <GridItem xs={12} sm={12} md={8}>
                <h2 className={classes.title}>Contact Me</h2>
                <h5 className={classes.description}>
                I am always open for new interesting projects and career possibilities. Feel free to send me an email, contact me in LinkedIn or give me a call!
                </h5>
                </GridItem>
            </GridContainer>
                <GridContainer>
                <GridItem xs={12} sm={12} md={4}>
                    <InfoArea
                    title="SPA with React, Material Kit and LinkedIn API"
                    description="It's this website you are looking at right now! The code is available in GitHub."
                    icon={Chat}
                    iconColor="info"
                    vertical
                    />
                </GridItem>
                <GridItem xs={12} sm={12} md={4}>
                    <InfoArea
                    title="Personal Blog"
                    description="WORK IN PROGRESS! Currently I am in the middle of creating my own blog with React and WordPress. You can follow my progress from GitHub."
                    icon={VerifiedUser}
                    iconColor="success"
                    vertical
                    />
                </GridItem>
                <GridItem xs={12} sm={12} md={4}>
                    <InfoArea
                    title="Master's Thesis: Parametric Modelling in Website Design"
                    description="Lorem ipsum"
                    icon={Fingerprint}
                    iconColor="danger"
                    vertical
                    />
                </GridItem>
            </GridContainer>
        </div>
      </div>
      </div>

  );
}
